import React from "react";
import { Link } from "react-router-dom";

export default function Welcome() {
    
  return (
    <>
    <div className="container" style={{display:"flex"}}>
      <button type="button" class="btn btn-outline-success"><Link to="/login"></Link>Login/signup for farmers</button>
      <button type="button" class="btn btn-outline-success">Login/signup for user</button>
    </div>
    </>
  )
}
